import { Dialog } from "@mui/material";

const dialogStyle ={
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: "100%",
    height: "100%",
    borderRadius: "5px",
}

const LoginDialog = () => {
  return <Dialog open={true}>Hello</Dialog>;
};

export default LoginDialog;
